// SPDX-License-Identifier: MIT
pragma solidity >=0.5.0 <0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/SafeCast.sol";

// ArtProject ERC721 Token
contract ArtProjectBase is ERC721, Ownable {
    using SafeMath for uint;
    using SafeCast for uint;

        //Project information
        struct Project {
            //Art details
            uint lifecycle;
            //Initial details
            string name;
            uint8 age;
            uint8 scope;
            uint8 state;
            //Attributes
            uint8 technique;
            uint8 aesthetics;
            uint8 usage;
            uint8 popularity;
        }
        //List of all projects
        Project[] public projects;

        constructor()ERC721("W3Arts", "3A")public{
        }
        //Create new project
        function newProject(
            uint _lifecycle,
            string memory _name,
            uint8 _age,
            uint8 _scope,
            uint8 _state,
            uint8 _technique,
            uint8 _aesthetics,
            uint8 _usage,
            uint8 _popularity,
            address _to
        ) public onlyOwner returns (uint)
        {
            uint id = projects.length;
            projects.push(
                Project(_lifecycle, _name, _age, _scope, _state,
                        _technique, _aesthetics, _usage, _popularity)
            );
            _safeMint(_to, id);
            return id;
        }
        //Cast and add a uint8 to a uint8
        function castAdd8(uint8 _a, uint8 _b) internal pure returns (uint8){
            return uint(_a).add(uint(_b)).toUint8();
        }
        //Cast and substract a uint8 from uint8
        function castSubstract8(uint8 _a, uint8 _b) internal pure returns(uint8){
            return uint(_a).sub(uint(_b)).toUint8();
        }
        //Cast and subtract a uint8 from a uint
        function castSubstract256(uint _a, uint8 _b) internal pure returns (uint){
            return _a.sub(uint(_b));
        }
}
